import React, { Component } from "react";

class Tab extends Component {
  render() {
    return (
      <React.Fragment>
        <ul>
          {this.props.items.map((item) => (
            <li>item</li>
          ))}
        </ul>
      </React.Fragment>
    );
  }
}

export default Tab;
